def clean_sequence(sequence):
    alphabet = np.array(["A", "C", "T", "G"])
    sequence = sequence.upper()
    clean_seq = ""
    for i in sequence:
        if i in alphabet:
            clean_seq += i
    return clean_seq

def canonical_kmer(kmer):
    return min(kmer, str(Seq(kmer).reverse_complement()))

def get_all_canonical_kmers(k):
    alphabet = np.array(["A", "C", "T", "G"])
    kmers = {canonical_kmer(''.join(p)) for p in product(alphabet, repeat=k)}
    return sorted(kmers)

def build_canonical_kmers(sequence,k):
    sequence = clean_sequence(sequence)
    return [canonical_kmer(sequence[i:i+k]) for i in range(len(sequence) - k + 1)]

def get_canonical_kmer_frequency(sequence, k):
    kmers_list_sequence = build_canonical_kmers(sequence, k)      
    dic = {i:kmers_list_sequence.count(i) for i in get_all_canonical_kmers(k)}
    keys = list(dic.keys())
    values = list(dic.values())
    total = sum(values)
    
    frequencies = {}
    
    for i in range(len(keys)):        
        frequencies[ keys[i] ] = values[i]/total
    
    return frequencies
   



